import React from 'react';

function App(){
   let Greting = '';
  let curDate = new Date(2021,25,23);
  curDate = curDate.getHours();
  const css = {}
  if(curDate <= 11 && curDate > 1){
     Greting = 'Good Mornig';
     css.color  = 'orange';
  }else if(curDate > 12 && curDate < 19){
    Greting = 'Good Afternoon';
    css.color = 'green';
  }else if(curDate <= 19 && curDate >= 24){
    Greting = 'Good Night';
    css.color = 'black';
  }

  return (
    <><h1>Hello sir , <span style={css}>{Greting}</span></h1></>
  )
}

export default App;
